import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Icon from '@material-ui/core/Icon';

const useStyles = makeStyles((theme) => ({
    root: {
        '& > *': {
            margin: theme.spacing(5),
            width: '100ch',
        },
    },
    formControl: {
        marginleft: '240px',
        minWidth: 200,
        width: '50ch',
    },
    margin: {
        margin: theme.spacing(100),
    },
}));

export default function TipoEmpresa() {
    const classes = useStyles();
    return (

        <form className={classes.root} noValidate autoComplete="off">
            <div className="flex">
                <div className="min-w-48 pt-20">
                    <Icon color="action">assignment_turned_in</Icon>
                </div>
                <FormControl variant="outlined" className={classes.formControl}>
                    <InputLabel htmlFor="outlined-age-native-simple">Tipo Empresa</InputLabel>
                    <Select
                        native
                        label="Tipo Empresa"
                        inputProps={{
                            name: 'tp-native-simple',
                            id: 'tp-native-simple',
                        }}
                    >
                        <option value={0} selected>SELECT...</option>
                        <option value={1}>PERSONA NATURAL</option>
                        <option value={2}>SOCIEDADES POR ACCIONES</option>
                    </Select>
                   {/*  <Select
                        className="mt-8 mb-16"
                        native
                        value={form.tipodoc}
                        onChange={handleChange}
                        label="Tipo Documento"
                        inputProps={{
                            name: 'tipodoc',
                            id: 'outlined-age-native-simple',
                        }}
                    >
                        <option aria-label="None" value="" />
                        <option value={'C.C'}>C.C</option>
                        <option value={'T.I'}>T.I</option>
                        <option value={'R.C'}>R.C</option>
                    </Select> */}
                </FormControl>
            </div>
           {/*  <FormControl className={classes.formControl}>
                <InputLabel htmlFor="tp-native-simple">Tipo de Empresa</InputLabel>
                <Select
                    native
                    inputProps={{
                        name: 'tp-native-simple',
                        id: 'tp-native-simple',
                       }}
                     >
                    <option value={0} selected>SELECT...</option>
                    <option value={1}>PERSONA NATURAL</option>
                    <option value={2}>SOCIEDADES POR ACCIONES</option>
                </Select>
            </FormControl> */}
        </form>
    );
}
